import { createTheme } from '@mui/material/styles';
import { blue } from '@mui/material/colors';

export const theme = createTheme({
  palette: {
    primary: {
        main: blue[900],
        contrastText: '#ececec',
    },
    secondary: {
      main: blue[200],
    },
  },
});
